import styled from 'styled-components';
import { Navbar } from 'react-bootstrap';

export const NavHeader = styled(Navbar)`
  background-color: ${props => props.backgroundColor};

  NavHeader.Brand {
    color: red;
  }
`;

export default { NavHeader };
